import React, { Component } from 'react'
import './index.css'
export default class Study extends Component {
  render(){
    return <div>
      <h3>一边听大提琴曲一边写着矫情的代码</h3>
      <h2>我就想到什么写什么吧，我喜欢语言类，计算机语言也是一种语言</h2>
    </div>
  }
}
